import React, { Component } from 'react';
import { Redirect } from 'react-router-dom';

class Tela404 extends Component {
    constructor(props){
        super(props);
        this.state = { redirecionar: false };
        console.log(this.props);
    }

    redirecionar = () => this.state.redirecionar = true;

    render(){
        if(this.state.redirecionar) {
            this.state.redirecionar = false;
            return ( <Redirect to="/" /> )
        }
        return(
            <h1>Esta página não foi encontrada. <span onClick={() => this.redirecionar()}>Clique aqui para voltar para a página inicial.</span></h1>
        )
    }
}

export default Tela404;
